// ZReport.js (React web version of ZReportGenerator)
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const ZReport = () => {
  const [reportData, setReportData] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchReport();
  }, []);

  const fetchReport = async () => {
    try {
      const res = await axios.get('/api/z-report');
      setReportData(res.data);
    } catch (err) {
      setError('Failed to fetch Z-report data.');
    }
  };

  const exportCSV = () => {
    const header = [
      'Hour', 'Transactions', 'Sales Revenue', 'Total Sales', 'Total Tax', 'Service Charges', 'Voids', 'Discards', 'Discounts', 'Employee Signatures', 'Payment Methods'
    ];
    const rows = reportData.map(row => [
      row.hour,
      row.total_transactions,
      row.sales_revenue,
      row.total_sales,
      row.total_tax,
      row.service_charges,
      row.voids,
      row.discards,
      row.discounts,
      row.employee_signatures,
      row.payment_methods
    ]);

    let csvContent = [header, ...rows].map(e => e.join(",")).join("\n");
    const blob = new Blob([csvContent], { type: 'text/csv;charset=utf-8;' });
    const url = URL.createObjectURL(blob);

    const link = document.createElement('a');
    link.setAttribute('href', url);
    link.setAttribute('download', 'Z_Report.csv');
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  };

  return (
    <div style={{ padding: 20 }}>
      <h2>📊 Z-Report (Today)</h2>
      {error ? (
        <p style={{ color: 'red' }}>{error}</p>
      ) : (
        <>
          <button onClick={exportCSV}>⬇️ Export CSV</button>
          <table border="1" cellPadding="5" style={{ marginTop: '20px', width: '100%' }}>
            <thead>
              <tr>
                <th>Hour</th>
                <th>Transactions</th>
                <th>Sales Revenue</th>
                <th>Total Sales</th>
                <th>Tax</th>
                <th>Service Charges</th>
                <th>Voids</th>
                <th>Discards</th>
                <th>Discounts</th>
                <th>Employee Signatures</th>
                <th>Payment Methods</th>
              </tr>
            </thead>
            <tbody>
              {reportData.map((row, idx) => (
                <tr key={idx}>
                  <td>{row.hour}</td>
                  <td>{row.total_transactions}</td>
                  <td>${row.sales_revenue.toFixed(2)}</td>
                  <td>${row.total_sales.toFixed(2)}</td>
                  <td>${row.total_tax.toFixed(2)}</td>
                  <td>${row.service_charges.toFixed(2)}</td>
                  <td>${row.voids.toFixed(2)}</td>
                  <td>${row.discards.toFixed(2)}</td>
                  <td>${row.discounts.toFixed(2)}</td>
                  <td>{row.employee_signatures}</td>
                  <td>{row.payment_methods}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </>
      )}
    </div>
  );
};

export default ZReport;
